import React, { useState } from "react";
import { Link, useNavigate } from "react-router-dom";
import "./Signup.css";

export default function SignupPage() {
    const [errorMessage, setErrorMessage] = useState("");
    const [formData, setFormData] = useState({
        fullName: "",
        email: "",
        mobile: "",
        date: "",
        password: "",
        confirmPassword: "",
    });
    
    const navigate = useNavigate();

    // Handle input change
    const handleChange = (e) => {
        setFormData({ ...formData, [e.target.name]: e.target.value });
    };

    const handleSignupSuccess = async (event) => {
        event.preventDefault();
        setErrorMessage("");

        const { fullName, email, mobile, date, password, confirmPassword } = formData;

        // Log values for debugging
        console.log("Submitting data:", formData);

        // Validate the form fields
        if (!fullName || !email || !mobile || !date || !password || !confirmPassword) {
            setErrorMessage("All fields are required!");
            return;
        }
        if (!/^[a-zA-Z]+(?: [a-zA-Z]+)*$/.test(fullName)) {
            setErrorMessage("Please enter a valid name!");
            return;
        }
        if (!/^[6-9][0-9]{9}$/.test(mobile)) {
            setErrorMessage("Please enter a valid mobile number!");
            return;
        }
        if (!/^([a-zA-Z0-9]+)@([a-zA-Z0-9]+)\.([a-zA-Z]{2,})(\.[a-zA-Z]{2,})?$/.test(email)) {
            setErrorMessage("Please enter a valid email!");
            return;
        }
        if (!/^(?=.*[0-9])(?=.*[a-z])(?=.*[A-Z])(?=.*[@#\$])[A-Za-z0-9@#\$]{6,12}$/.test(password)) {
            setErrorMessage(
                "Password must be 6-12 characters, with at least one digit, one lowercase letter, one uppercase letter, and one special character (@, #, $)"
            );
            return;
        }
        if (password !== confirmPassword) {
            setErrorMessage("Passwords do not match!");
            return;
        }

        // Prepare data to send to the server
        const requestData = {
            name: fullName,
            email: email,
            mobileno: mobile,
            joiningdate: date,
            password: password,
        };
        
        console.log("Data being sent to server:", requestData);

        try {
            const response = await fetch("http://localhost:8085/api/farmers/addUser", {
                method: "POST",
                headers: { "Content-Type": "application/json" },
                body: JSON.stringify(requestData),
            });

            console.log("Response received:", response);

            if (response.status === 409) {
                const text = await response.text();
                throw new Error(text || "User already exists! MobileNo or Email");
            }
            if (!response.ok) {
                throw new Error(`Server error: ${response.status}`);
            }

            const data = await response.json();
            console.log("User added:", data);
            alert("User added successfully!");
            navigate("/logins");
        } catch (error) {
            console.error("Error:", error);
            setErrorMessage(error.message);
        }
    };

    return (
        <div className="signup-wrapper">
            <div className="signup-card">
                <Link to="/loginc" className="signup-link">Back</Link>
                <h2 className="signup-header">Create an Account</h2>
                <form className="signup-form" onSubmit={handleSignupSuccess}>
                    {errorMessage && <p className="signup-error-message">{errorMessage}</p>}
                    <input className="signup-input-field" type="text" name="fullName" placeholder="Full Name" value={formData.fullName} onChange={handleChange} required />
                    <input className="signup-input-field" type="email" name="email" placeholder="Email" value={formData.email} onChange={handleChange} required />
                    <input className="signup-input-field" type="text" name="mobile" placeholder="Mobile Number" value={formData.mobile} onChange={handleChange} required />
                    <input className="signup-input-field" type="date" name="date" value={formData.date} onChange={handleChange} required />
                    <input className="signup-input-field" type="password" name="password" placeholder="Password" value={formData.password} onChange={handleChange} required />
                    <input className="signup-input-field" type="password" name="confirmPassword" placeholder="Confirm Password" value={formData.confirmPassword} onChange={handleChange} required />
                    <button type="submit" className="signup-btn">Sign Up</button>
                </form>
                <div className="signup-footer">
                    <p>Already have an account? <Link to="/logins" className="signup-link">Sign In</Link></p>
                </div>
            </div>
        </div>
    );
}
